import React, { useState, useEffect } from "react";
import { useNavigate } from 'react-router-dom';
import Manager_Product_List from "./Manager_Product_List";
import Manager_Add_Product from "./Manager_Add_Product";
import Manager_Orderding_List from "./Manager_Orderding_List";
import Manager_Profits from "./Manager_Profits";
import { Link, Outlet } from "react-router-dom";
import '../App.css';
export default function Client_Nav(props) {
    const [mystyle, setMystyle] = useState({});
    const [mystyle1, setMystyle1] = useState({});
    const [mystyle2, setMystyle2] = useState({});
    const [mystyle3, setMystyle3] = useState({});
    
    const [lastClicked, setLastClicked] = useState({});

    let navigate=useNavigate();
    useEffect(() => {
        setMystyle({
            color: "white",
            fontSize:" 20px",
            marginRight:" 200px",
            paddingTop: "20px",
            paddingBottom: "3%",
            paddingLeft: "20px",
            paddingRight: "20px",
            display: "inline-block",
            transition:" 0.7s"
        });
        setLastClicked({
              fontSize: "30px",
            marginLeft:"90px",
            marginRight: "190px",
            backgroundColor: "wheat",
            transition: "0.12s"
        });
        setMystyle1(mystyle);
        setMystyle2(lastClicked);
        setMystyle3(mystyle);
        console.log("mystyle= "+mystyle);
        console.log("mystyle1= "+mystyle1);
        console.log("mystyle2= "+mystyle2);
        console.log("mystyle3=  "+mystyle3);
        console.log("lastClicked= "+lastClicked);


    }, []);
    return (
    <div>
        <div className="n">
            <nav className="navs">
                <Link className="App-link" style={lastClicked} onClick={()=>{
                    setMystyle1(lastClicked );
                    setMystyle2(mystyle);
                    setMystyle3(mystyle);
                    }} to={`/client/shopingCart`}>shopping-cart</Link>

                <Link className="App-link" style={mystyle2} onClick={()=>{
                    setMystyle1(mystyle );
                    setMystyle2(lastClicked);
                    setMystyle3(mystyle);
                    }} to={`/client`}>product list</Link>

                <Link className="App-link" style={mystyle3} onClick={()=>{
                    setMystyle1(mystyle );
                    setMystyle2(mystyle);
                    setMystyle3(lastClicked);
                    }} to={`/Log_Out`}>log out</Link>
            </nav>
            <Outlet />
        </div>
      
    </div>);
}
